59;a:1:{s:5:"image";s:250:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118677255_2772290786386467_7439823879819747549_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=103&_nc_ohc=AkdoSoB7zkkAX9mcBLq&oh=2485599490a143f91b976846135c0aaf&oe=5F7AC506";}i:60;a:1:{s:4:"type";s:7:"sidecar";}i:61;a:1:{s:8:"owner_id";i:18500898417;}i:62;a:1:{s:14:"owner_username";s:0:"";}i:63;a:1:{s:14:"owner_fullname";s:0:"";}i:64;a:1:{s:9:"owner_pic";s:0:"";}i:65;a:1:{s:2:"id";s:19:"2391020825904251956";}i:66;a:1:{s:10:"short_code";s:11:"CEunMXilYQ0";}i:67;a:1:{s:12:"created_time";i:1599251915;}i:68;a:1:{s:7:"caption";s:2084:"Parfümlerimizin neden fiyatının yüksek olduğunu soranlar için bilgi paylaşmak istiyorum bizdeki parfümler hem kalıcı hemde doğal sağlık ürünüdür ucuz parfümlerin zararları aşağıda yazılı🤸
Çoğu cilt problemleri, hormon metabolizmasının bozulması ve kanser dâhil bir dizi ciddi sağlık probleminin nedeni sentetik kimyasalların bir kokteyli görünümüne sahip olmasıdır. Dikkat etmemiz gereken en kötü katkı maddelerinin arasında çözücü ve fiksatif dietil ftalat (DEP) ve sentetik ‘misk’ olarak bilinen sahte parfümler geliyor.

Hem DEP hem de türev monoetil ftalat (MEP) göğüs kanseri ve sperm DNA hasarıyla bağlantılıdır ve parfüm kullananların idrarında MEP düzeyinin iki katından fazla olduğu bulunmuştur. Östrojenik etkilere sahip olan sentetik miskler meme kanseri ile de ilişkilidir ve diğer toksik kimyasalların etkilerini daha da kötüleştirebilecek eylemlere sahiptir. 

Kokuların çoğu solunum sistemi için tahriş edici özelliği olan uçucu organik bileşiklerdir ve astımlı hastalarda öksürük, hırıltılı solunum ve nefes darlığına neden olduğu eskiden beri bilinmektedir. Bazı kokular burun tıkanıklığı, sinüzit, öksürük, boğaz ağrısı ve göğüste sıkışma hissi de oluşturabilir. Kalp, dolaşım ve beynin elektrik aktivitesi üzerine de etkileri olduğunu ortaya koyulmuştur. Bunlar baş ağrısı, yoğunlaşma bozukluğu, yorgunluk, uyuşukluk gibi şikâyetlerdir. 

Kokuların en çok etkilediği organ derimizdir. Kaşıntı, kabartı, egzama bunların başlıcalarıdır. Kokular; gözlerde sulanma, kaşıntı ve kızarmalara yol açabilir. Araştırmalar deriden emilen kokuların daha sonra parçalanarak ve başka bileşiklere dönüşerek de etkili olabileceklerini gösteriyor. Aroma molekülleri olarak bilinen diğerleri, benzersiz bir kokuya sahip yeni moleküllerdir. Son zamanlara kadar “merhem” ve “parfüm” kaynakları doğal ve zararsızdı ama artık çoğu sentetik.
