pour cela on fait une petite virée chez @adoptparfums qui propose un large choix de cosmétiques, bijoux et maroquineries, mais pas que, l’enseigne vend un produit fard qui est le parfum, ce que est l’une de meilleure vente. 
Pourquoi? 
Car le concept a été créer par un parfumeur de formation.
☝️Notez bien que c’est de l’eau de parfum et non de l’eau de toilette et là est la différence, l’odeur reste donc longtemps et ça sent hyper bon. 
Les parfums sont fabriqués en France, à Bordeaux avec des artisans partenaires à Grasse qui est la capitale mondiale de la parfumerie pour les connaisseurs 😜.
L’eau de parfum est de qualité car les matières premières sont récoltées au meilleur de leur potentiel olfactif, les composants naturels sont sélectionnées parmi les meilleures essences : la vanille gourmande des Antilles, l’Ylang Ylang voluptueux de Madagascar, les roses délicates du Maroc cueillies justes écloses. 
Ils ont fait une gamme homme depuis qui est plutôt pas mal. 

Les parfum d’intérieur sont tendance aujourd’hui, perso j’utilise le musc Blanc en parfum d’intérieur sur les rideaux ou le linge, ça dégage une bonne odeur de propre et de frais dans la maison. 
